import React from 'react'

const LoginFailed = () => {
  return (
    <div className="login-fail">
        <div className="text-box">
            <h1>Oops, looks like your your username</h1>
            <h1>or your password is incorrect!</h1>
        </div>
    </div>
  )
}

export default LoginFailed
